import React, { useContext } from 'react';
import { ThemeContext } from '../context/ThemeContext';
import { Link } from 'react-router-dom';

function Header() {
  const { darkMode, setDarkMode } = useContext(ThemeContext);

  return (
    <header className="w-full bg-blue-600 text-white shadow">
      <div className="max-w-7xl mx-auto flex flex-col items-center px-6 py-4">
        <h1 className="text-2xl font-bold mb-4 text-center">üèçÔ∏è Bike Rentals</h1>

        <nav className="flex justify-center flex-wrap gap-6 text-lg">
          <Link to="/" className="hover:underline">Home</Link>
          <Link to="/book" className="hover:underline">Book</Link>
          <Link to="/rent" className="hover:underline">Rent Out</Link>
          <Link to="/profile" className="hover:underline">Profile</Link>
          <button
            onClick={() => setDarkMode(!darkMode)}
            className="px-3 py-1 border rounded bg-white text-blue-600 hover:bg-gray-100 hover:text-blue-700 transition text-sm"
          >
            {darkMode ? '‚òÄÔ∏è Light' : 'üåô Dark'}
          </button>
        </nav>
      </div>
    </header>
  );
}

export default Header;
